-- Squences
CREATE SEQUENCE IF NOT EXISTS bus_id_seq1

-- Table Definition
CREATE TABLE "public"."bus" (
    "id" int4 NOT NULL DEFAULT nextval('bus_id_seq1'::regclass),
    "related_to" varchar,
    "tx_id" varchar,
    "ao_id" varchar,
    "source" varchar,
    "status" varchar,
    "url" text,
    "departure" timestamp,
    "parent" varchar,
    "next" varchar,
    "previous" varchar,
    "path" text,
    "payload" text,
    "created_at" timestamp,
    "updated_at" timestamp,
    "result" text,
    "picked" timestamp,
    "received" timestamp,
    PRIMARY KEY ("id")
);

